import React,{Component} from 'react';

function TopNavRightIcon(props) {
    
    return (
        <a
            href={props.IconInfo.href}
            title={props.IconInfo.title}
            id={props.IconInfo.id}
        >{props.IconInfo.media}<i className={props.IconInfo.className}
            ></i></a>
    );
};

export default TopNavRightIcon;
